import axios from 'axios';
import { useNavigate, useParams } from "react-router-dom";
import { Cabecera } from "../cabecera/cabecera";
import React, { useState, useEffect } from 'react';

export const AreaPersonal = () => {

    const { idUsuario } = useParams()
    const URIrecetas = "http://localhost:8000/recetas/"
    const URIrecetasUsuario="http://localhost:8000/recetasusuarios/"
    const URIUsuario="http://localhost:8000/usuarios/"
    const [recipes, setRecipes] = useState([]);
    const [recetasU, setRecetasU]= useState([])
    const [usuario,setUsuario] = useState({})
    const navigate = useNavigate();

    useEffect(() => {
        getRecetaByID()

    }, [])


    const getRecetaByID = async () => {
        try {

            const res = await axios.get(URIrecetasUsuario + idUsuario);
            setRecetasU(res.data);

            const promises = res.data.map(async (id) => {
                const res2 = await axios.get(URIrecetas + id.idReceta);
                return res2.data;
            });

            const recipesData = await Promise.all(promises);
            setRecipes(recipesData);
        } catch (error) {
            console.error(error);
        }
        const res3 = await axios.get(URIUsuario + idUsuario)
        setUsuario(res3.data)
    };


    const URIhorario="http://localhost:8000/horario/"

    const crearHorario = async(e)=>{
        e.preventDefault()

        const ver= await axios.post(URIhorario, {
            d1: e.target.d1.value,
            a1: e.target.a1.value,
            c1: e.target.c1.value,
            d2: e.target.d2.value,
            a2: e.target.a2.value,
            c2: e.target.c2.value,
            d3: e.target.d3.value,
            a3: e.target.a3.value,
            c3: e.target.c3.value,
            d4: e.target.d4.value,
            a4: e.target.a4.value,
            c4: e.target.c4.value,
            d5: e.target.d5.value,
            a5: e.target.a5.value,
            c5: e.target.c5.value,
            d6: e.target.d6.value,
            a6: e.target.a6.value,
            c6: e.target.c6.value,
            d7: e.target.d7.value,
            a7: e.target.a7.value,
            c7: e.target.c7.value
        })
        console.log(ver)
        navigate(`/areaPersonal/${localStorage.getItem('user')}`);
    }

    const URIrecetasusuarios = "http://localhost:8000/recetasusuarios"
    const borrarReceta = async (id, e) => {
        e.preventDefault()
        try{
            const idReceta=id;
            const idUsuario=localStorage.getItem('user');

            const result = axios.delete(URIrecetasusuarios,{
                IDU: idUsuario,
                IDR: idReceta
            })
            console.log(result)
            alert("Receta elimanada con éxito.");
        }catch (error){
            console.error("Algo falló " + error);
            alert("Error al eliminar receta");
        }
    }


    return (
        <div>
            <Cabecera />
            <div className='parteDeArriba'>
                        <h1 className='medioUsuarios tituloBuscador margenTxt'>Bienvenido {usuario.nombre}</h1>
                        <h3 className='h3Usuarios centrarTxt margentB'>Estas son tus recetas guardadas</h3>
                        </div>
            <div className="container">
                <div className="row">
                    <div className="col-sm-12 mb-4">
                        <div className="row">

                        {recipes.map(recipe => (
                                <div className="col-sm-3" key={recipe.id}>
                                    <div className="card centrarTxt cartaRec">
                                        <img className="card-img-top" src={recipe.Image_Name} alt={recipe.title} style={{ objectFit: 'cover', height: '200px' }} />
                                        <div className="card-body">
                                            <h5 className="card-title">{recipe.Tittle}</h5>
                                            <div>
                                                <a href={`/recetaExtendida/${recipe.id}`} className="btn btn-success"> Receta completa</a>
                                                <button onClick={borrarReceta.bind(this, recipe.id)} className="btn btn-success" type="submit">Borrar</button>
                                            </div>
                                        </div>
                                    </div>
                                </div>
                            ))}
                        </div>
                    </div>
                </div>
            </div>

            <div className='container'>
            <h2 className='h3Usuarios centrarTxt'>¡Planifica tu semana con tus recetas guardadas!</h2>
            <div className="horarioSemanal margenTxt">
                <form name="horario" onSubmit={crearHorario} >
                    <table className="table table-bordered" >
                        <tr>
                            <th></th>
                            <th>DESAYUNO</th>
                            <th>ALMUERZO</th>
                            <th>CENA</th>
                        </tr>
                        <tr>
                            <th>LUNES</th>
                            <td>
                                <select name="d1">
                                    {recipes.map(recipe => (
                                        <option value={recipe.id}>{recipe.Tittle}</option>
                                    ))}
                                </select>
                            </td>
                            <td>
                                <select name="a1">
                                    {recipes.map(recipe => (
                                        <option value={recipe.id}>{recipe.Tittle}</option>
                                    ))}
                                </select>
                            </td>
                            <td>
                                <select name="c1">
                                    {recipes.map(recipe => (
                                        <option value={recipe.id}>{recipe.Tittle}</option>
                                    ))}
                                </select>
                            </td>
                        </tr>
                        <tr>
                        <th>MARTES</th>
                        <td>
                            <select name="d2">
                               {recipes.map(recipe => (
                                    <option value={recipe.id}>{recipe.Tittle}</option>
                                ))}
                            </select>
                         </td>
                         <td>
                            <select name="a2">
                                {recipes.map(recipe => (
                                    <option value={recipe.id}>{recipe.Tittle}</option>
                                 ))}
                            </select>
                         </td>
                         <td>
                            <select name="c2">
                                {recipes.map(recipe => (
                                    <option value={recipe.id}>{recipe.Tittle}</option>
                                    ))}
                                </select>
                            </td>
                        </tr>
                        <tr>
                        <th>MIERCOLES</th>
                        <td>
                                <select name="d3">
                                    {recipes.map(recipe => (
                                        <option value={recipe.id}>{recipe.Tittle}</option>
                                    ))}
                                </select>
                            </td>
                            <td>
                                <select name="a3">
                                    {recipes.map(recipe => (
                                        <option value={recipe.id}>{recipe.Tittle}</option>
                                    ))}
                                </select>
                            </td>
                            <td>
                                <select name="c3">
                                    {recipes.map(recipe => (
                                        <option value={recipe.id}>{recipe.Tittle}</option>
                                    ))}
                                </select>
                            </td>
                        </tr>
                        <tr>
                        <th>JUEVES</th>
                        <td>
                                <select name="d4">
                                    {recipes.map(recipe => (
                                        <option value={recipe.id}>{recipe.Tittle}</option>
                                    ))}
                                </select>
                            </td>
                            <td>
                                <select name="a4">
                                    {recipes.map(recipe => (
                                        <option value={recipe.id}>{recipe.Tittle}</option>
                                    ))}
                                </select>
                            </td>
                            <td>
                                <select name="c4">
                                    {recipes.map(recipe => (
                                        <option value={recipe.id}>{recipe.Tittle}</option>
                                    ))}
                                </select>
                            </td>
                        </tr>
                        <tr>
                        <th>VIERNES</th>
                        <td>
                                <select name="d5">
                                    {recipes.map(recipe => (
                                        <option value={recipe.id}>{recipe.Tittle}</option>
                                    ))}
                                </select>
                            </td>
                            <td>
                                <select name="a5">
                                    {recipes.map(recipe => (
                                        <option value={recipe.id}>{recipe.Tittle}</option>
                                    ))}
                                </select>
                            </td>
                            <td>
                                <select name="c5">
                                    {recipes.map(recipe => (
                                        <option value={recipe.id}>{recipe.Tittle}</option>
                                    ))}
                                </select>
                            </td>
                        </tr>
                        <tr>
                        <th>SABADO</th>
                        <td>
                                <select name="d6">
                                    {recipes.map(recipe => (
                                        <option value={recipe.id}>{recipe.Tittle}</option>
                                    ))}
                                </select>
                            </td>
                            <td>
                                <select name="a6">
                                    {recipes.map(recipe => (
                                        <option value={recipe.id}>{recipe.Tittle}</option>
                                    ))}
                                </select>
                            </td>
                            <td>
                                <select name="c6">
                                    {recipes.map(recipe => (
                                        <option value={recipe.id}>{recipe.Tittle}</option>
                                    ))}
                                </select>
                            </td>
                        </tr>
                        <tr>
                        <th>DOMINGO</th>
                        <td>
                                <select name="d7">
                                    {recipes.map(recipe => (
                                        <option value={recipe.id}>{recipe.Tittle}</option>
                                    ))}
                                </select>
                            </td>
                            <td>
                                <select name="a7">
                                    {recipes.map(recipe => (
                                        <option value={recipe.id}>{recipe.Tittle}</option>
                                    ))}
                                </select>
                            </td>
                            <td>
                                <select name="c7">
                                    {recipes.map(recipe => (
                                        <option value={recipe.id}>{recipe.Tittle}</option>
                                    ))}
                                </select>
                            </td>
                        </tr>
                    </table>
                    <button type="submit" className='btn btn-success btn-lg margenBoton'>Crear horario</button>
                </form>
            </div>
            </div>


        </div>


    )
}
